import React from "react";
import "../styles/Experience.css";

export default function Experience() {
  const experiences = [
    {
      role: "Java Fullstack Developer Intern",
      company: "Digital Microsys Technologies",
      duration: "6 Months",
      description: "Worked on fullstack Java projects using JDBC, Servlet, JSP, and Oracle SQL/PLSQL."
    },
    {
      role: "MERN Stack Intern",
      company: "Infosys Springboard",
      duration: "3 Months",
      description: "Developed web applications using MongoDB, Express, React, Node.js."
    }
  ];

  return (
    <section id="experience" className="experience-section">
      <h2 className="section-title">Experience</h2>
      <div className="timeline">
        {experiences.map((exp, index) => (
          <div key={index} className={`timeline-item ${index % 2 === 0 ? "left" : "right"}`}>
            <div className="timeline-content">
              <h3>{exp.role}</h3>
              <h4>{exp.company}</h4>
              <span className="duration">{exp.duration}</span>
              <p>{exp.description}</p>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
}
